feedBack.innerHTML = svgFeed
clear.innerHTML = svgClear



class serverPack {
    constructor(message)
    {   
        this.sender = 'admin';
        this.msg = message;
    }
}
const createTabs = (msg) =>{
    const {name,c_id} = msg;
    const tabcont = document.createElement('div');
    tabcont.classList.add('shadow');
    tabcont.classList.add('major');
    for(let i = 0; i < 3; i++)
    {
        const tabs = document.createElement('span');
        switch(true)
        {
            case i === 0:
                tabs.textContent = name;
                tabs.classList.add('tabsInner')
            break;
            case i === 1:
                tabs.textContent = c_id;
                tabs.classList.add('tabsInner')
            break;
            case i === 2:
                tabs.classList.add('removebtn');
                tabs.classList.add('button')
                tabs.innerHTML = svgDel;
                tabs.addEventListener('click', e =>{
                    ws.send(JSON.stringify(new serverPack({purpose:'disconnect',id:c_id})));
                })
        }
        tabcont.appendChild(tabs)
    }
    tabular.appendChild(tabcont)
}

const createTabular = (msg) =>{
    msg.forEach(val =>{
        createTabs(val)
    })
}

const removeTab = (msg) =>{
    const {c_id} = msg;
    const arrayTabs = Array.from(document.querySelectorAll('.major'));
    let removed = arrayTabs.filter(val =>{return val.querySelectorAll('span')[1].textContent === c_id});
    tabular.removeChild(removed[0])

}

const createFeedBack = (msg) =>{
    const p = document.createElement('p');
    p.innerText = msg;
    p.classList.add('shadow')
    feedTab.appendChild(p);
}

const updateFeedback = (msg) =>{
    if(msg.length > 0)
    {
        feedTab.innerHTML = '';
        msg.forEach(val =>{
            createFeedBack(val)
        })
    }
}

ws.addEventListener('open', ()=>{

    ws.addEventListener('close', e =>{
        alert('net disconnected')
    })
    console.log('connection made')
    const enterMessage = new serverPack('Userrequest');
    ws.send(JSON.stringify(enterMessage));

    document.querySelector('.clear').addEventListener('click', e =>{
        const msg = new serverPack('clearFeedback');
        ws.send(JSON.stringify(msg));
        feedTab.innerHTML = '';
        createFeedBack('no messages yet');
    })

    ws.addEventListener('message', ({data}) =>{
        let parsed = JSON.parse(data);
        switch(true)
        {
            case parsed.purpose === 'admin':
                switch(true)
                {
                    case parsed.method === 'gen':
                        console.log(parsed.uid)
                        total.textContent = parsed.online
                        unique.textContent = parsed.uid;
                        activeTemp = parsed.message.length
                        active.textContent = activeTemp
                        createTabular(parsed.message);
                        updateFeedback(parsed.feedBack)
                    break;
                    case parsed.method === 'update':
                        total.textContent = parsed.online;
                        unique.textContent = parsed.uid;
                        activeTemp++
                        active.textContent = activeTemp
                        createTabs(parsed.message)
                    break;
                    case parsed.method === 'remove':
                        removeTab(parsed.message);
                        activeTemp--;
                        active.textContent = activeTemp;
                    break;
                    case parsed.method === 'uniqueness':
                        unique.textContent = parsed.uid;
                    break;
                    case parsed.method === 'feedBackUpdate':
                        switch(true){
                            case feedTab.children[0].innerHTML === 'no messages yet':
                                feedTab.innerHTML = ''
                        }
                        createFeedBack(parsed.message);
                }
        }
    })
})
